function tableRateFromAPI(p) {
    var o = p.getAttribute("data-rft-ratefee");
    var j = p.getAttribute("data-rft-defaultval");
    var k = p.getAttribute("data-rft-subtext");
    var b = p.getAttribute("data-rft-productname");
    var f = "";
    var h = "";
    var l = "";
    var c = "";
    var f = "";
    var g = "";
    if (b && b != "None" && asbApiData) {
        if (b.indexOf("-") >= 0) {
            h = b.split("-");
            l = h[0].trim();
            c = h[1].trim();
            if (typeof h[2] != "undefined") {
                g = h[2];
            } else {
                g = "";
            }
        } else {
            l = b;
        }
        if (g == "SpecialRate") {
            g = "SpecialRate";
        } else {
            g = "";
        }
        f = getRateValue(asbApiData, l, c, g);
        if (!f) {
            f = j;
        }
    } else {
        f = j;
    }
    displayTableRate(p, f, k, o);
}

function tableRatefeesFromMicroAPI(k) {
    var f = k.getAttribute("data-rft-ratefee");
    var b = k.getAttribute("data-rft-defaultval");
    var g = k.getAttribute("data-rft-subtext");
    var c = k.getAttribute("data-rft-term");
    var h = k.getAttribute("data-rft-productname");
    var j = "";
    if (h && h != "None" && microApiData) {
        j = getRateValue(microApiData, h, c, "");
        if (!j) {
            j = b;
        }
    } else {
        j = b;
    }
    displayTableRate(k, j, g, f);
}
var ratePrefix = "";
var feePrefix = "";

function displayTableRate(g, f, c, b) {
    ratePrefix = "";
    feePrefix = "";
    if (f) {
        f = f.toString();
        if (f.indexOf(".") >= 0) {
            f = parseFloat(f);
            if (!isNaN(f)) {
                f = f.toFixed(2);
                if (b == "rate") {
                    ratePrefix = "%";
                } else {
                    if (b == "fee") {
                        feePrefix = "$";
                    }
                }
            }
        } else {
            if (b == "rate") {
                if (isNaN(f)) {
                    f = f;
                    ratePrefix = "";
                } else {
                    f = f + ".00";
                    ratePrefix = "%";
                }
            }
            if (b == "fee") {
                if (isNaN(f)) {
                    f = f;
                    feePrefix = "";
                } else {
                    feePrefix = "$";
                }
            }
        }
        if (b == "rate") {
            g.innerHTML =
                "<td>" +
                f +
                '<span class="unit">' +
                ratePrefix +
                "</span> " +
                c +
                "</td>";
        } else {
            if (b == "fee") {
                g.innerHTML =
                    '<td><span class="unit">' +
                    feePrefix +
                    "</span>" +
                    f +
                    " " +
                    c +
                    "</td>";
            }
        }
    }
}

